import React from 'react';
import PropTypes from 'prop-types';

const AppLayout = ({children}) => {
  return (
    <div>
      <div>공통 메뉴</div>
      {children}
    </div>
  );
};

AppLayout.propTypes = {
  children : PropTypes.node.isRequired,  // react의 node && 화면에 그릴 수 모든 것들이 node
}


export default AppLayout;
